import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import Sidebar from "../components/Sidebar";
import NotebookContent from "../components/NotebookContent";
import { getDocument} from "../services/api";

export default function Notebook() {
  const { id } = useParams();
  const [doc, setDoc] = useState(null);

  useEffect(() => {
    getDocument(id)
    .then(data => {
      console.log("Notebook loaded:", data);
      setDoc(data);
    })
    .catch(err => {
      console.error("Error loading notebook:", err);
    });
    
    
    // getDocument(id).then(setDoc);

  }, [id]);

  return (
    <div className="flex min-h-screen bg-gray-50">
      <Sidebar selectedDoc={doc} />

      <main className="flex-grow p-10 overflow-y-auto">
        {doc ? (
          <NotebookContent doc={doc} />
        ) : (
          <div className="text-gray-500 text-lg">Loading Notebookssss...</div>
        )}
      </main>
    </div>
  );
}
